import React from 'react';
import '../styles/charts.css'
export default function ToggleSlider() {

    return (
        <div className="toggleContainer">
        <label className="switch">
        <input type="checkbox"/>
        <span className="slider round"></span>
      </label>
    </div>
    );

}
